import { Link } from 'react-router-dom';

const DUMMY_EVENTS = [
	{ id: 'ev1', title: 'Event 1' },
	{ id: 'ev2', title: 'Event 2' },
	{ id: 'ev3', title: 'Event 3' }
];
const EventsPage = () => {
	return (
		<section>
			<h1>List of Events:</h1>
			<ul>
				{DUMMY_EVENTS.map(ev => (
					<li key={ev.id}>
						<Link to={ev.id}>{ev.title}</Link>
					</li>
				))}
			</ul>
		</section>
	);
};
export default EventsPage;
